import Footer from '../components/Footer';
import Button from "@material-tailwind/react/Button";
import Icon from "@material-tailwind/react/Icon";
import FacebookIcon from '@material-ui/icons/Facebook';

import "firebase/compat/app";
import { Link } from "react-router-dom";
//import {auth} from "../firebase";
function Login() {
    return (
       <>
       <Header/>
       <div className="bg-gray-200">
           <div className="items-center mt-30 px-5 py-6">
           {/*<Button
              color="blue"
            //onClick={()=>auth.signInWithRedirect(new firebase.auth.GoogleAuthProvider())}
            iconOnly={true}
            rounded={false}
            ripple="dark"
            className=" w-40 border-0  text-white items-center"
            >
                <div className="flex flex-row justify-between">
                <div>
                <Icon name="google" className="ml-5 pt-1 text-white" size="3xl" color="gray"/>

                </div>
                    <div className="text-uppercase pt-2 pb-2">
                    Login with Google
                    </div>

                </div>
           </Button>*/}
           <div className="flex flex-col items-center justify-center w-screen h-screen bg-gray-200 text-gray-700">
	<form className="flex flex-col bg-white rounded shadow-lg p-12 mt-12">
		<label className="font-semibold text-xs" for="usernameField">Username or Email</label>
		<input className="flex items-center h-12 px-4 w-64 bg-gray-200 mt-2 rounded focus:outline-none focus:ring-2" type="text"/>
		<label className="font-semibold text-xs mt-3" for="passwordField">Password</label>
		<input className="flex items-center h-12 px-4 w-64 bg-gray-200 mt-2 rounded focus:outline-none focus:ring-2"type="password"/>
		<button className="flex items-center justify-center h-12 px-6 w-64 bg-blue-600 mt-8 rounded font-semibold text-sm text-blue-100 hover:bg-blue-700">Login</button>
		<Button
              color="blue"
            //onClick={()=>auth.signInWithRedirect(new firebase.auth.GoogleAuthProvider())}
            iconOnly={true}
            rounded={false}
            ripple="dark"
            className=" flex items-center justify-center h-12 px-6 w-64 bg-blue-600 mt-8 rounded font-semibold text-sm text-blue-100 hover:bg-blue-700"
            >

                <Icon name="google" className="ml-5 pt-1 text-white" size="3xl" color="gray"/>


                    Login with Google

           </Button>
           <Button
              color="blue"
            //onClick={()=>auth.signInWithRedirect(new firebase.auth.GoogleAuthProvider())}
            iconOnly={true}
            rounded={false}
            ripple="dark"
            className=" flex items-center justify-center h-12 px-6 w-64 bg-blue-600 mt-8 rounded font-semibold text-sm text-blue-100 hover:bg-blue-700"
            >

                <FacebookIcon size="3xl" color="blue-500"/>


                    Login with Facebook

           </Button>
        <div className="flex mt-6 justify-center text-xs">


			<Link className="text-blue-400 text-sm hover:text-blue-500" to="profam/signup">Sign Up</Link>
		</div>
	</form>


</div>
           </div>


       </div>
       <Footer/>
       </>
    )
}

export default Login
